// src/components/Footer.js
import React,{useState,useEffect} from 'react';

function Footer() {
  return (
    <footer className="footer">
      <p>&copy; 2024 Planter Mood Lighting. All rights reserved.</p>
      <div className="social-media">
        <a href="#">Facebook</a>
        <a href="#">Instagram</a>
        <a href="#">Twitter</a>
      </div>
    </footer>
  );
}

export default Footer;
